import requests

url = "https://google-local-rank-tracker.p.rapidapi.com/geopoint-search"
querystring = {"zoom": zoom, "query": query, "lng": lng, "lat": lat}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "google-local-rank-tracker.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

